    true,nt"url": null,nt"notes": "<p>This release contains the Chronic Conditions
    Public Use Files (PUF) with information from Medicare claims. The CMS Chronic Conditions
    PUF is an aggregated file in which each record is a profile or cell defined by the
    characteristics of Medicare beneficiaries. A profile is defined by all combinations
    of age category, gender, various chronic conditions, and dual-eligibility status
    of the beneficiaries.</p>n",nt"license_title": "Other License Specified",nt"extras":
